import React from 'react';

import '../App.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';
import {NavDropdown, NavItem} from 'react-bootstrap';
import InputGroup from 'react-bootstrap/InputGroup'



const Header = () =>{
    return (
       
    <Navbar className=" color3">
        <Navbar.Brand href="#home">
            <img src="https://media.discordapp.net/attachments/315005339613265923/689333380378001508/logito.png?width=475&height=475" width="125" height="125" alt=""/>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
        <Nav className="mr-auto">
         <InputGroup className="mb-3">
            <FormControl
            placeholder="Recipient's username"
            aria-label="Recipient's username"
            aria-describedby="basic-addon2"
            />
         <InputGroup.Append>
            <Button variant="outline-secondary">Button</Button>
         </InputGroup.Append>
        </InputGroup>
            <NavItem inline><Button variant="warning" className="justify-content-end"> Registrate</Button>{' '}</NavItem> 
            <Nav.Link href="#link">  <Button variant="outline-danger">Danger</Button>{' '}</Nav.Link>
        </Nav>
     
        </Navbar.Collapse>
    </Navbar>
    );
}
export default Header;
